import './App.css';
import logospiderman from './imagenes/spiderman.webp'

function App() {
  return (
    <div className="App">
      <div className='logo-contenedor'>
        <img
          src={ logospiderman }
          className='logo'/>
      </div>
      <div className='tareas'>
        <h1>Mis SpiderTareas</h1>
      </div>
    </div>
  );
}

export default App;
